void mainImage( out vec4 o, in vec2 u )
{
	vec2 uv = (u*2.-iResolution.xy)/iResolution.x;
    float pixelSize = length(iResolution.xy)*.4;

    float maxis = max(abs(uv.x),abs(uv.y)),
        ldst = log(maxis*20.);
    o = fract(vec4(ldst-iTime)+vec4(0,1,2,3)*fract(iTime*.5));
}
